<div class="bot40" style="text-align:justify">
    Ez a Mass Attack Planner magyar nyelvű verziója. A segítségével egyszerre több célpontra tervezhetsz támadásokat vagy erősítéseket.
    Kompatibilis a Klánháború összes szerverével. Csak változtasd meg az értékeket a "Világ beállításai" opciónál.
    A tervezés az oldalon látható négy lépésben történik.
	Az indítások célponthoz történő hozzárendelésének módja optimalizált, és lehetővé teszi különböző időintervallumok kiválasztását, amelyekbe beállíthatod az indításokat.
    A tervezés eredményét táblázatba vagy a Klánháborúba lehet exportálni, a BB kódoknak köszönhetően.
</div>

