<div id="popup3" class="massap_popup">
    <div class="massap_popup_inside">
        <b>(3) Automatic assignment</b><br>
        <ul>
            <li>
                <b>Method of assignment</b><br>
                The assignment method consists to select the villages that arrive earlier to target, depending on the distance and the troop choosed
                (consequently, the travel time).
                <br> 
                The assignment order follows the order of the targets in the list "Target villages list:" inside step (1) "(1) Target villages".
            </li>
            <li> 
                <b>Use preferably following time slots during planning:</b><br>
                It is possible to suggest to the assignment method the time slots in which plan the launchs.
                There are 24 bands total that are considered as follows: "[08:09]" means that starts from 8:00:00 until 8:59:59.
                Click on the boxes to enable or disable (gray box = off).
                <br><br> 
                If, based on the time bands setted, the method can't assign all the villages needed to the targets,
                it repeats more times the calculation with a tolerance which increases 5 minutes progressively.
                <br><br>
                Practical example with arbitrary values:
                <br>
                I need to assign one attack to one target and I have three villages A1, A2, A3.
                Based on the date of arrival and the time of travel, the times of launch are A1=9:17, A2=13:42, A3=17:30.
                <br>
                In the typical scenario, with all the slots active, the method chooses A3 because it takes less time to arrive.
                <br>
                If I activate the time slots "[13-14]", "[14-15]" and "[16-17]" (others are gray) the method chooses A2
                because the time of launch falls into one of three slots.                
                <br>
                If I activate only the time slot "[08-09]" the method does not find any village and sets a tolerance of 5 minutes.
                The chosen slot will "expand" and become "[7:55-9:05]."
                The method continues to try and increase tolerance: "[7:50-9:10]", "[7:45-9:15]" until "[7:40-9:20]."
                At this point the method chooses A1.
            </li>
        </ul>
    </div>
</div>


<div id="popup4" class="massap_popup">
    <div class="massap_popup_inside">
        <b>(4) Planning</b><br>
        <ul>
            <li>
                <b>Plain text optimized for spreadsheets</b><br>
                If activated, the fields will be separated by a comma and spaces will be removed.
                To import the planning into a spreadsheet (Excel, LibreOffice Calc, etc.) copy the result
                and paste it into a new text file with TXT extension, e.g. using Notepad.                
                Open the spreadsheet, go to menù "File-&gt;Open", change "File type" in "Text file (*.csv, *.txt)", select the text file of the planning.
                The spreadsheet will ask how to recognize the fields, choose "separated by a comma."
            </li>
            <li>
                <b>Invert date format: yyyy/mm/dd</b><br>
                If activated, the date will start with the year value then the month and the day. This format allows you to
                sort the rows when they the planning is exported into a spreadsheet.
            </li>
            <li>
                <b>Show only essential columns</b><br>
                If activated, the columns with information deemed "unnecessary" will be hidden.
                Columns that will remain: start, target, unit, action, launch date.
            </li>
            <li>
                <b>BB-Code without table</b><br>
                If activated, planning in BB-Code will be created without the table structure.
                Useful when the planning has many rows and could exceed the limit of characters "[]" allowed in Tribal Wars.
            </li>
        </ul>   
    </div>
</div>


